import './assets/App.css';
import './assets/css/bootstrap.min.css'

function App() {
  return (
    <>
      <p class="lead">
        This is a lead paragraph. It stands out from regular paragraphs.
      </p>
      <div className="container-md">
        <div className="row">
          <div className="col">
            1 of 2
          </div>
          <div className="col">
            2 of 2
          </div>
        </div>
      </div>
    </>
  );
}

export default App;
